INSERT INTO `offers` (price, id, description, name, offer_type) VALUES (100,42,'Jednorazowa sesja treningowa z osobistym trenerem, dostosowana do Twoich potrzeb i celów fitness. Trener pomoże Ci zrealizować Twoje cele poprzez indywidualnie dobrane ćwiczenia i techniki.','Trening indywidualny','ONE_TIME'),(150,43,'Nielimitowany dostęp do siłowni przez cały miesiąc. Skorzystaj z nowoczesnego sprzętu i przestrzeni treningowej bez ograniczeń czasowych.','Miesięczny karnet na siłownię','SUBSCRIPTION'),(50,44,'Jednorazowe zajęcia jogi prowadzone przez doświadczonego instruktora. Zrelaksuj się i popraw swoją elastyczność oraz siłę w kameralnej grupie.','Zajęcia jogi','ONE_TIME'),(120,45,'Nielimitowany dostęp do basenu przez cały miesiąc. Ciesz się pływaniem w dogodnych godzinach i korzystaj z wszystkich udogodnień naszego obiektu.','Karnet na basen','SUBSCRIPTION'),(80,46,'Jednorazowy trening bokserski z trenerem, który nauczy Cię podstawowych technik oraz poprawi Twoją kondycję. Doskonały wybór dla początkujących i zaawansowanych.','Trening boksu','ONE_TIME'),(60,47,'Jednorazowe zajęcia aerobiku prowadzone przez doświadczonego instruktora. Popraw swoją kondycję i spal kalorie w rytmie energetycznej muzyki.','Zajęcia aerobiku','ONE_TIME'),(130,48,'Nielimitowany dostęp do różnorodnych zajęć fitness przez cały miesiąc. Wybierz spośród jogi, aerobiku, pilatesu i innych.','Miesięczny karnet na zajęcia fitness','SUBSCRIPTION'),(200,49,'Jednorazowa sesja masażu relaksacyjnego, która pomoże Ci się zrelaksować i zregenerować po intensywnym treningu lub stresującym dniu.','Sesja masażu','ONE_TIME'),(100,50,'Nielimitowany dostęp do sauny przez cały miesiąc. Zrelaksuj się i oczyść swoje ciało w naszej nowoczesnej saunie.','Karnet na saunę','SUBSCRIPTION'),(90,51,'Jednorazowe zajęcia pływania z instruktorem, dostosowane do Twojego poziomu umiejętności. Popraw swoją technikę pływacką i pewność siebie w wodzie.','Indywidualne zajęcia pływania','ONE_TIME'),(140,52,'Nielimitowany dostęp do zajęć ze sztuk walki przez cały miesiąc. Trenuj karate, judo, taekwondo i inne pod okiem doświadczonych instruktorów.','Karnet na sztuki walki','SUBSCRIPTION'),(110,53,'Jednorazowy trening personalny z wykwalifikowanym trenerem personalnym. Indywidualnie dobrany program treningowy, wsparcie motywacyjne i techniczne, dostosowane do Twoich celów i potrzeb.','Trening personalny','ONE_TIME'),(70,54,'Jednorazowe zajęcia z piłki nożnej prowadzone przez doświadczonego trenera. Doskonała okazja do nauki podstawowych technik i gry zespołowej.','Zajęcia z piłki nożnej','ONE_TIME'),(160,55,'Nielimitowany dostęp do treningów grupowych przez cały miesiąc. Skorzystaj z różnorodnych form treningu i ciesz się atmosferą grupowych zajęć.','Miesięczny karnet na treningi grupowe','SUBSCRIPTION'),(120,56,'Jednorazowe konsultacje dietetyczne z doświadczonym dietetykiem. Otrzymaj spersonalizowany plan żywieniowy, dostosowany do Twoich potrzeb zdrowotnych i celów fitness.','Dietetyczne konsultacje','ONE_TIME');
